import { Component } from "react";
import React from "react";
class App extends Component{
  constructor(){
      super()
      this.state={
          count:0
      }
  }

  render(){
      return(
          <div>
              <h1>{this.state.count}</h1>
              <button onClick={this.state.count++}>change</button>
          </div>
      )
  }
}

export default App
